  false,\n\t\"url\": null,\n\t\"notes\": \"The survey visited all active fish camps
  to determine numbers of fish caught and methods of capture and preservation. Major
  streams were surveyed to determine escapement numbers and location of spawning areas.
  Chum salmon, Oncorhynchus keta, were found to be the most important species in the
  fishery. Silver salmon, Oncorhynchus kisutch, said to be the most abundant salmon,
  are not heavily utilized.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
